import React from 'react';
import { Col, Container, Image } from 'react-bootstrap';
import Logo from '../assets/images/logoW.png'
function Welcome() {
    return (
        <Container style={{ backgroundColor: '#17223B' }}>
            <Col xs={4} md={4}>
                <Image alt="" src={Logo} />
            </Col>
        </Container>
    )
}
export default Welcome
